import React, { Component } from 'react';


class BottomNav extends Component {


    render() { 

        function changeView (id){
                console.log(id)
        }


        return (
        <div className="container">

            <ul>
                <li><a id="calculator" onClick="changeView(this.id)">Calculator</a></li>
                <li><a id="data" onClick={changeView(this.id)}>Data</a></li>
            </ul>

        </div>
            );
    }
}
 
export default BottomNav;
